import { Router } from "express";
import "./App.css";
import Header from "./components/Header.js";
import MainContent from "./components/MainContent.js";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Header />
          <MainContent />
        </Switch>
      </Router>
    </>
  );
}

export default App;
